CREATE TABLE [dbo].[Suburb](
   city   nvarchar(20) NOT NULL PRIMARY KEY
  ,Region nvarchar(17) NOT NULL
  ,means  int  NOT NULL
  ,area   numeric(9,1) NOT NULL
);


CREATE TABLE [dbo].[Rent](
   Rent_id      INTEGER  NOT NULL PRIMARY KEY 
  ,Suburb_name  nvarchar(20) NOT NULL
  ,Region_name  nvarchar(17) NOT NULL
  ,Unit_type    INTEGER  NOT NULL
  ,Year         INTEGER  NOT NULL
  ,Average_rent nVARCHAR(5) NOT NULL
);

 CREATE TABLE [dbo].[Job](
   Job_id      INTEGER  NOT NULL PRIMARY KEY 
  ,Suburb_name nVARCHAR(20) NOT NULL
  ,Region_name nVARCHAR(17) NOT NULL
  ,Job_type    nVARCHAR(47) NOT NULL
  ,Year        INTEGER  NOT NULL
  ,Total_jobs  INTEGER  NOT NULL
);

CREATE TABLE [dbo].[Hospital](
   Hospital_id   INTEGER  NOT NULL PRIMARY KEY 
  ,Hospital_name nVARCHAR(70) NOT NULL
  ,Type          nVARCHAR(7) NOT NULL
  ,suburb_name   nVARCHAR(21) NOT NULL
  ,Postcode      INTEGER  NOT NULL
  ,Region_name   nVARCHAR(17) NOT NULL
);

 
 CREATE TABLE [dbo].[Park](
   Park_id     INTEGER  NOT NULL PRIMARY KEY 
  ,name        nVARCHAR(51) NOT NULL
  ,Suburb_name nVARCHAR(45) NOT NULL
  ,Latitude    nVARCHAR(11) NOT NULL
  ,longitude   nVARCHAR(11) NOT NULL
);


CREATE TABLE [dbo].[College](
   College_id       INTEGER  NOT NULL PRIMARY KEY 
  ,Region_name      nVARCHAR(17) NOT NULL
  ,Suburb_name      nVARCHAR(20) NOT NULL
  ,Institution_name nVARCHAR(100) NOT NULL
  ,Address          nVARCHAR(67) NOT NULL
  ,City             nVARCHAR(50) NOT NULL
  ,Latitude         nVARCHAR(11) NOT NULL
  ,Longitude        nVARCHAR(11) NOT NULL
  ,Area_type        nVARCHAR(12) NOT NULL
);


select a.Suburb_name,a.Region_name,a.Unit_type,a.Year,a.Average_rent,b.Job_type,b.Total_jobs
into [dbo].[Rent_jobs]
from Rent a inner join Job b on
a.Suburb_name = b.Suburb_name
order by (a.Year) asc;

select suburb_name,count(*) as Total_hospitals
into [dbo].[Total_hospitals]
from Hospital
group by (suburb_name)
order by (suburb_name) asc;

select Suburb_name,count(*) as Total_parks
into [dbo].[Total_parks]
from Park
group by (Suburb_name)
order by (Suburb_name) asc;

select Suburb_name,count(*) as Total_colleges
into [dbo].[Total_colleges]
from College
group by (Suburb_name)
order by (Suburb_name) asc;

select a.suburb_name,Total_hospitals,Total_parks,Total_colleges
from Total_hospitals a
left join Total_parks b on a.suburb_name = b.Suburb_name
left join Total_colleges c on a.suburb_name = c.Suburb_name;

select a.suburb_name,b.Region,a.Total_hospitals
into [dbo].[Hospital_count]
from Total_hospitals a
left join Suburb b on a.suburb_name = b.city;

select a.Suburb_name,b.Region,a.Total_parks
into [dbo].[Park_count]
from Total_parks a
left join Suburb b on a.suburb_name = b.city;

update College set City='Greater Bendigo' where Suburb_name='bendigo';
select * from College;

select a.Suburb_name,b.Region,a.Total_colleges
from Total_colleges a
left join Suburb b on a.suburb_name = b.city;

drop table Total_colleges;

select City,count(*) as Total_colleges
into [dbo].[Total_colleges]
from College
group by (City)
order by (City) asc;

select a.City,b.Region,a.Total_colleges
into [dbo].[College_count]
from Total_colleges a
left join Suburb b on a.City = b.city
where b.Region is not null;

distinct Job_type from Job;


select a.Suburb_name,a.Region_name,a.Unit_type,a.Year,a.Job_type,a.Total_jobs,b.Total_hospitals,c.Total_parks,d.Total_colleges
into [dbo].[Aggregates]
from Rent_jobs a
left join Hospital_count b on a.Suburb_name=b.suburb_name
left join Park_count c on a.Suburb_name = c.Suburb_name
left join College_count d on a.Suburb_name = d.City;

update Aggregates set Total_parks = 0 where Total_parks is NULL;

select distinct Region_name 
into [dbo].[Regions]
from Aggregates;
alter table Regions add constraint pk primary key(Region_name);

create table [dbo].[Selected_region]
( Region_name nvarchar(17) not null,
  foreign key (Region_name) references Regions(Region_name));